The distinction between a "coroutine" and a "generator" can be a bit vague, varying from one discussion to the next. In these notes a generator is anything which directly implements Iterator or Stream while a coroutine is anything which can take arbitrary input, yield arbitrary output, and later resume execution at the previous yield. Thus, the "generator" syntax proposed in eRFC-2033 and currently implemented behind the "generator" feature is actually a coroutine syntax for the sake of these notes, not a true generator . RFC-2996 defines a true generator syntax in "future additions". Note also that "coroutines" here are really "semicoroutines" since they can only yield back to their caller. I will continue to group the original eRFC text and the later generator resume arguments extension togther as " eRFC-2033 ". That way I only have 3 big proposals to deal with. In rustc, a coroutine's "witness" is the space where stack-allocated values are stored if needed across yields. I'm borrowing this terminology here. Any such cross-yield bindings are said to be "witnessed". // This is an example coroutine which might assist a streaming base64 encoder
|sextet, octets| { let a = sextet; // witness a, b, and c sextets for later use yield; let b = sextet; octets.push(a << 2 | b >> 4); // aaaaaabb yield; let c = sextet; octets.push((b & 0b1111) << 4 | c >> 2); // bbbbcccc yield; octets.push((c & 0b11) << 6 | sextet) // ccdddddd
} // This is an example generator which might be used in Iterator::flat_map.
gen { for item in inner { for mapped in func(item) { yield mapped; } }
} // This is an example async generator which might be used in Stream::and_then
async gen { while let Some(item) = inner.next().await { yield func(item).await; }
}

