All proposals want movability/impl Unpin to be inferred. If we forbid "borrowed data escaping into closure state", the inference rules should be relatively simple: witnessing any borrow triggers immovability. Dead borrows should not be witnessed. But exact inference rules may only be well understood after an attempt at implementation. Soundness of pin_mut! is a little tricky but seems to be fine no matter what. If the resulting mutable borrow is witnessed ⇒ coroutine is !Unpin because of inference rules If the pinned data is !Unpin and is witnessed ⇒ coroutine is !Unpin because witness contains !Unpin data Thus, if the coroutine can be moved after resume, any data stack-pinned (really witness-pinned) by pin_mut! is not referenced and is Unpin. Until inference is solved, the static keyword can be used as a modifier. // movable via inference
|| { let x = 4; let y = &x; dbg!(y); yield;
} // guaranteed movable (pending inference)
static || { ...
} // immovable
|| { let x = 4; let y = &x; yield; dbg!(y);
}

