In this example, we are building a crate which provies a safe wrapper around an underlying C API. The C API contains at least one function which accepts a function pointer to be used as a callback: mod c_api { extern { pub fn call_me_back(f: extern "C" fn()); }
} We would like to allow users of our crate to safely use their own callbacks. The problem is that if the callback panics, we would unwind into C code and this would be undefined behaviour. To avoid this, we would like to interpose between the user-provided callback and the C API, by wrapping it in a call to catch_unwind. Unfortunately, the C API offers no way to pass an additional "custom data" field that we could use to store the original function pointer. Instead, we could write a generic function like this: use std::{panic, process}; pub fn call_me_back_safely<F: Fn() + Default>(_f: F) { extern "C" fn catch_unwind_wrapper<F: Fn() + Default>() { if panic::catch_unwind(|| { let f = F::default(); f() }).is_err() { process::abort(); } } unsafe { c_api::call_me_back(catch_unwind_wrapper::<F>); }
} This compiles, and is intended to be used like so: fn my_callback() { println!("I was called!")
} fn main() { call_me_back_safely(my_callback);
} However, this will fail to compile with the following error: error[E0277]: the trait bound fn() {my_callback}: Default is not satisfied

